import React, { useState } from 'react';

const Contact=()=>{
  const [data,setData]=useState({
    fullname:'',
    phone:'',
    email:'',
    msg:'',
  });
  const formSubmit=()=>{

  };
  return(
    <>
      <div className="my-5">
        <h1 className="text-center">Contact Us</h1>
      </div>
      <div className="container contact_div">
            <div className="row">
                <div className="col-10 col-md-6 mx-auto">
                  <form onSubmit={formSubmit}>
                    <div className="mb-3">
                      <label for="exampleInputEmail1">Full Name</label>
                      <input type="text" className="form-control" name="" value="" onChange={inputEvent} placeholder="Enter your name" id="exampleInputEmail1" aria-describedby="emailHelp" required/>
                    </div>
                    <div className="mb-3">
                      <label for="exampleInputPassword1">Mobile no</label>
                      <input type="number" className="form-control" name="" value="" onChange={inputEvent} placeholder="Enter your no." id="exampleInputPassword1" required/>
                    </div>
                    <div className="mb-3">
                      <label for="exampleInputPassword1">Email Id</label>
                      <input type="email" className="form-control" name="" value="" onChange={inputEvent} placeholder="Enter your email id" id="exampleInputPassword1" required/>
                    </div>
                    <div className="mb-3">
                      <label for="exampleInputPassword1">Message</label>
                      <textarea className="form-control" name="" value="" onChange={inputEvent} placeholder="Enter your email id" rows="3" id="exampleInputPassword1"/>
                    </div>
                    <button type="submit" className="btn btn-outline-primary">Submit</button>
                  </form>
                </div>
            </div>
        </div>
    </>
  );
};
export default Contact;
